Passion (2013) 

FEEL the passion burn between five compelling lesbian couples. Watch the sensuality sizzle as Nicole Smith heats up Paige Turnah before turning her attentions to AVN award winner Samantha Bentley.
Serious sparks fly between Cindy Hope and Cipriana, but your screen will literally melt when Zafira acts out her love for Sophie Lynx. Complete with Viv Thomas' trademark kissing, intimate feelings and exceptional production values.

